import './App.css';
import React from 'react';
import AutoCompleteInput from './AutoCompleteInput';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="App">

        <AutoCompleteInput text='City'/>

      </div>
    );
  }
}

export default App;
